import React from 'react';
import spareLines from "../data/spareLines"

export default function SpareLines() {


  console.log(spareLines)
  // const renderSpareList = () => {
  //   return spareLines.forEach((e) => (
  //     {e}
  //   ))
  // }

  const renderSpareList = () => {
    return spareLines.map((item, i) => (
      <div style={{
        width: "200px",
        height: "30px",
        borderRadius: "5px",
        marginBottom: "5px",
        textAlign: "center",
        fontSize: "17px",
        backgroundColor: "#4382BC",
      }}>
        {item}
      </div>
    ))
  }

  renderSpareList()

  return (
    <div style={{
      width: "220px", 
      margin: "73px 0px 0px 20px",
      height: "85vh",
      overflowY: "scroll",
    }}>
      {renderSpareList()}
    </div>
  )
}
